<!-- HTML for static distribution bundle build -->
<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <title>Swagger UI</title>
    <link rel="stylesheet" type="text/css" href="swagger-ui/swagger-ui.css" />
    <link rel="stylesheet" type="text/css" href="swagger-ui/index.css" />
    <link
      rel="icon"
      type="image/png"
      href="swagger-ui/favicon-32x32.png"
      sizes="32x32"
    />
    <link
      rel="icon"
      type="image/png"
      href="swagger-ui/favicon-16x16.png"
      sizes="16x16"
    />
    <link
      rel="stylesheet"
      href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.2.0/css/all.min.css"
      integrity="sha512-xh6O/CkQoPOWDdYTDqeRdPCVd1SpvCA9XXcUnZS2FmJNp1coAFzvtCN9BmamE+4aHK8yyUHUSCcJHgXloTyT2A=="
      crossorigin="anonymous"
      referrerpolicy="no-referrer"
    />
  </head>

  <body>
    <div id="swagger-ui"></div>
    <script src="swagger-ui/swagger-ui-bundle.js" charset="UTF-8"></script>
    <script
      src="swagger-ui/swagger-ui-standalone-preset.js"
      charset="UTF-8"
    ></script>
    <script src="swagger-ui/swagger-initializer.js" charset="UTF-8"></script>
  </body>
</html>
